import React from 'react';

class LearnReactHeader extends React.Component {
    render(){
        return (
            <div className="learn-react-header">
                <h1 style={{color: "#ffffff", border:".1em solid #ffffff"}}>Learn React</h1>
            </div>
        );
    }
}

export default LearnReactHeader
